import axios from "axios";
import React, { useState } from "react";

const OyuncuDetay = () =>{

    const [oyuncuDetay,setOyuncuDetay]=useState([])

    axios.get("https://cryptic-gorge-72989.herokuapp.com/players")
    .then(response=>{
        setOyuncuDetay(response)
    })

    return(
        <div>

            <h1>
                {
                    oyuncuDetay.map(oyuncu=>
                        <div>
                            {oyuncu.name}
                        </div>
                        )
                }
            </h1>

        </div>
    )
}

export default  OyuncuDetay;
